            init: function(){

                self = this;

                inputSerialNumb = jQuery('.serialNumberText');
                inputRepairCompany = jQuery('.repairCompanyText');
                inputDocumentNumber = jQuery('.documentNumberText');
                inputItemCode = jQuery('.itemCodeText');
                inputQty = jQuery('.quantity');


                printersSelect = document.getElementById('printersSelect');

                self.loadPrinters();

                label = self.labelXML();
                self.updatePreview();

                self.captureSerialNumber();
                self.captureItemCode();
                self.captureDocumentNumber();
                self.captureRepairCompany();

                self.downloadLabel();
                self.printAction();

                self.loadQueryParams();

                setTimeout(function () {

                    $('.itemCodeText, .serialNumberText, .documentNumberText,.repairCompanyText').trigger('blur');

                    if (jQuery('.isPrint').val().length > 0) {

                        if (jQuery('.isPrint').val() == "true") {

                            self.updatePreview();

                            $('#printButton').trigger('click');

                            jQuery('.isPrint').val('');

                        }

                    }

                }, 600);

                jQuery('.checkEnvironment').click(function () {
                    self.dymoPrintCheckEnvironment();
                });

            },

            loadQueryParams: function(){

                var serialQP = self.getQueryParameters('serial');
                if(serialQP !== null)inputSerialNumb.val(serialQP);

                var itemQP = self.getQueryParameters('item');
                if(itemQP !== null) inputItemCode.val(itemQP);

                var documentQP = self.getQueryParameters('document');
                if(documentQP !== null) inputDocumentNumber.val(documentQP);

                var identityQP = self.getQueryParameters('identity');
                if(identityQP !== null) $('.repairCompanyText').val(identityQP);

                var qtyQP = self.getQueryParameters('quantity');
                if(qtyQP !== null) $('.quantity').val(qtyQP);

                var printQP = self.getQueryParameters('print');
                if(printQP !== null) jQuery('.isPrint').val(printQP);

                $('.itemCodeText, .serialNumberText, .documentNumberText,.repairCompanyText').trigger('blur');

                self.updatePreview();

            },

            updatePreview: function(){
                if (!label)
                    return;

                var pngData = label.render();

                var labelImage = document.getElementById('labelImage');
                labelImage.src = "data:image/png;base64," + pngData;
            },

            loadPrinters: function(){
                printers = dymo.label.framework.getPrinters();
                if (printers.length == 0)
                {
                    console.log("No DYMO printers are installed. Install DYMO printers.");
                    return;
                }

                for (var i = 0; i < printers.length; i++)
                {
                    var printerName = printers[i].name;

                    var option = document.createElement('option');
                    option.value = printerName;
                    option.appendChild(document.createTextNode(printerName));
                    printersSelect.appendChild(option);
                }
            },

            download: function(filename, text){
                var element = document.createElement('a');
                element.setAttribute('href', 'data:text/xml;charset=utf-8,' + encodeURIComponent(text));
                element.setAttribute('download', filename);

                element.style.display = 'none';
                document.body.appendChild(element);

                element.click();

                document.body.removeChild(element);
            },

            downloadLabel: function(){

                jQuery('#previewButton').click(function(){

                    self.updatePreview();

                    if(self.formValidation()) {

                        if (label) {
                            self.updatePreview();
                            self.download('dymoprint.label', label);
                        } else {
                            alert('label not generated.');
                        }
                    }

                });

            },

            printAction: function(){
                $('#printButton').click(function(){
                    try
                    {
                        if (!label)
                        {
                            alert("Load label before printing");
                            return;
                        }
                        if(self.formValidation()) {

                            self.updatePreview();

                            if(parseInt(inputQty.val()) > 1){
                                self.multiLabelPrint(inputQty.val());
                            }else{
                                label.print(printersSelect.value);
                            }

                        }
                    }
                    catch(e)
                    {
                        alert(e.message || e);
                    }
                });
            },

            multiLabelPrint: function(qty){
                var labelSetBuilder = new dymo.label.framework.LabelSetBuilder();
                var i = '';
                var record = '';

                for(i=1; i<= qty; i++){

                    record = labelSetBuilder.addRecord();
                    //self.updateLabelRecord(record);
                    var srNmb = $('.serialNumberText').val();

                    record.setText('QRCODE', srNmb);
                    record.setText('SERIAL_TEXT', srNmb);

                    var itmCode = $('.itemCodeText').val();
                    record.setText('ITEM_CODE', $(this).val());

                    var docNmb = $('.documentNumberText').val();
                    record.setText('DOC_NAME', docNmb);
                    record.setText('BARCODE', docNmb);

                    var repairCompany = $('.repairCompanyText').val();
                    record.setText('REPAIR_COMPANY', repairCompany);
                }

                label.print(printersSelect.value, "", labelSetBuilder);

            },

            updateLabelRecord: function(record){

                var srNmb = $('.serialNumberText').val();

                record.setObjectText('QRCODE', srNmb);
                record.setObjectText('SERIAL_TEXT', srNmb);

                var itmCode = $('.itemCodeText').val();
                record.setObjectText('ITEM_CODE', $(this).val());

                var docNmb = $('.documentNumberText').val();
                record.setObjectText('DOC_NAME', docNmb);
                record.setObjectText('BARCODE', docNmb);

                var repairCompany = $('.repairCompanyText').val();
                record.setObjectText('REPAIR_COMPANY', repairCompany);

            },

            formValidation: function () {

                if($(inputSerialNumb).val().length == 0){
                    alert('Serial Number is required');

                    return false;

                }

                if($(inputItemCode).val().length == 0){
                    alert('Item Code is required');

                    return false;

                }

                if($(inputDocumentNumber).val().length == 0){
                    alert('Document Number is required');
                    return false;

                }

                if($('.quantity').val().length == 0 || $('.quantity').val() == 0){
                    alert('Quantity must be defined / greater than zero.');

                    return false;

                }

                return true;

            },

